import React from 'react';
import Navbar from './Navbar';
import Contact from './Contact'
import About from './About'
import {BrowserRouter as Router, Route} from 'react-router-dom'


function App1() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="about">

            <Route exact path="/">
              <About />
            </Route>
            <Route path="/contact">
              <Contact />
            </Route>

        </div>
      </div>
    </Router>
  );
}

export default App1;
